DROP TABLE IF EXISTS `shop_area`;
CREATE TABLE `shop_area` (
  `area_id` varchar(32) NOT NULL COMMENT '索引ID',
  `area_name` varchar(50) NOT NULL COMMENT '地区名称',
  `area_parent_id` varchar(32) NOT NULL DEFAULT '0' COMMENT '地区父ID',
