  `id` bigint(20) not null auto_increment,
  `company_name` varchar(20) collate utf8_bin default null comment '公司名称',
  `user_name` varchar(50) collate utf8_bin default null comment '负责人',
  `person_charge` varchar(11) collate utf8_bin default null comment '负责人电话',
  `person_picup` varchar(20) collate utf8_bin default null comment '对接人',
  `company_address` varchar(50) collate utf8_bin default null comment '单位地址',
