  `prop2` varchar(255) DEFAULT NULL COMMENT '备用字段',
  `prop3` varchar(255) DEFAULT NULL COMMENT '备用字段',
  `prop4` varchar(255) DEFAULT NULL COMMENT '备用字段',
  `prop5` varchar(255) DEFAULT NULL COMMENT '备用字段',
