	`classroom_uniformity` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '教室照度均匀度',
	`blackboard_illumination` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '黑板照度',
